import logo from './logo.svg';
import './App.css';

function App() {
  const blogOjb ={
    title: 'Blog Title 1',
    desc: 'Description'
  }
  return (
    <div className="App">
      <div style={
        {
        margin: '16px',
        padding: '16px',
        boxSizing: 'border-box',
        borderRadius: '5px',
        boxShadow: '0 2px 5px #ccc'
        }
      }>
        <h3>{blogOjb.title}</h3>
        <p>{blogOjb.desc}</p>
      </div>
      <hr></hr>
      <div>
        <h3>{blogOjb.title}</h3>
        <p>{blogOjb.desc}</p>
      </div>
      <hr></hr>
      <div>
        <h3>{blogOjb.title}</h3>
        <p>{blogOjb.desc}</p>
      </div>
    </div>
  );
}

export default App;
